import React from "react";
import MainButton from "./MainButton";

import styles from "./Calculator.module.css";


const Calculator = () => {

const handlerFunction = () => {

}

  return (
    <>
      <div className={styles["calculator-wrapper"]}>
        <div className={styles["calculator-display"]}>
          <div className={styles.totalDisplay}>100</div>
        </div>
        <div className={styles["calculator-Keyboard"]}>
          <div className={styles.keysFunction}>
            <MainButton keyValue={"C"} onClick={handlerFunction} />
            <MainButton keyValue={"\xB1"} onClick={handlerFunction} />
            <MainButton keyValue={"%"} onClick={handlerFunction} />
          </div>
          <div className={styles.keysOperation}>
            <MainButton keyValue={"/"} onClick={handlerFunction} />
            <MainButton keyValue={"*"} onClick={handlerFunction} />
            <MainButton keyValue={"-"} onClick={handlerFunction} />
            <MainButton keyValue={"+"} onClick={handlerFunction} />
            <MainButton keyValue={"="} onClick={handlerFunction} />
          </div>
          <div className={styles.keysDigits}>
            <MainButton keyValue={9} onClick={handlerFunction} />
            <MainButton onClick={handlerFunction}  />
            <MainButton onClick={handlerFunction} keyValue={7} />
            <MainButton onClick={handlerFunction} keyValue={6} />
            <MainButton onClick={handlerFunction} keyValue={5} />
            <MainButton onClick={handlerFunction} keyValue={4} />
            <MainButton onClick={handlerFunction} keyValue={3} />
            <MainButton onClick={handlerFunction} keyValue={2} />
            <MainButton onClick={handlerFunction} keyValue={1} />
            <MainButton
              className={styles.keyZero}
              onClick={handlerFunction}
              keyValue={0}
            />
            <MainButton
              className={styles.keyDat}
              onClick={handlerFunction}
              keyValue={","}
            />
          </div>
        </div>
      </div>
    </>
  );
}

export default Calculator
